function submit(){var result=$("#form_post").validate();if(result){$("#form_post").submit();}}
function downloadFile(path){document.location.href=path;}
function getPostSearchType(post_type){action="";switch(post_type)
{case"Assignments":action="/post_assignments/search";break;case"Tests":action="/post_tests/search";break;case"Projects":action="/post_projects/search";break;case"Exams":action="/post_exams/search";break;case"QAs":action="/post_qas/search";break;case"Education":action="/post_educations/search";break;case"Tutors":action="/post_tutors/search";break;case"Books":action="/post_books/search";break;case"Jobs":action="/post_jobs/search";break;case"Party":action="/post_parties/search";break;case"Student Awareness":action="/post_awarenesses/search";break;case"Housing":action="/post_housings/search";break;case"Team Up":action="/post_teamups/search";break;case"MyX":action="/post_myxes/search";break;case"Food":action="/post_foods";break;case"Schedules":action="/post_exam_schedules";break;}
$('#action_post_search').attr("action",action);}
function load_options(){$("#department").mcDropdown("#department_menu",{width:170,valueAttr:"rel_department",select:option_submit});$("#year").mcDropdown("#year_menu",{width:75,valueAttr:"rel_year",select:option_submit});$("#over").mcDropdown("#over_menu",{width:80,valueAttr:"rel_over",select:option_submit});}
function option_submit(){$("#action_option").submit();}
function send_comment(id,type){comment=$('#comment').val();if(comment!=""){$.ajax({url:'/posts/create_comment',type:'GET',cache:false,dataType:'html',data:({commentable_id:id,commentable_type:type,comment:comment}),success:function(data){$('#list_comments').append(data);$('#comment').val('');$('#form_comment').toggle('slow');}});}}
function send_answer(post_id){comment=$('#comment').val();if(comment!=""){$.ajax({url:'/post_qas/create_comment',type:'GET',cache:false,dataType:'html',data:({post_id:post_id,comment:comment,show:$('#show').val()}),success:function(data){$('#list_comments').html(data);$('#comment').val('');$('#form_comment').toggle('slow');}});}}
function sendEmail(current_user_id,user_id){subject=$('#message_subject').val();body=$('#message_body').val();$.ajax({url:'/users/'+current_user_id+'/messages/send_message',type:'GET',cache:false,dataType:'html',data:({recipient_id:user_id,subject:subject,body:body}),success:function(data){$('#div_send_message').html(data);}});}
function sendReportAbuse(){reported_id=$('#reported_id').val();reported_type=$('#reported_type').val();abuse_type_id=$('#abuse_type_id').val();abuse_content=$('#abuse_content').val();if(reported_id!=""&&reported_type!=""&&content!=""){$.ajax({url:'/posts/create_report_abuse',type:'GET',cache:false,dataType:'html',data:({reported_id:reported_id,reported_type:reported_type,abuse_type_id:abuse_type_id,abuse_content:abuse_content}),success:function(data){$('#div_send_report').html(data);}});}}
function requireRating(post_id,path){rating=$('input[name=rating]:checked').val();if(rating!=""){$.ajax({url:path,type:'GET',cache:false,dataType:'html',data:({rating:rating,post_id:post_id}),success:function(data){$('#require_rating_action').html(data);}});}}
function showResult(){$('[rel=rate]').each(function(index){$(this).show();});$('#view_results').hide();}
function showCommentForm(wall_id){$('#wall_comment_form_'+wall_id).show();$('#wall_comment_'+wall_id).hide();$('#comment_'+wall_id).focus();}
function hideCommentForm(wall_id){if($('#comment_'+wall_id).val()==""){$('#wall_comment_'+wall_id).show();$('#wall_comment_form_'+wall_id).hide();}}
function goToByScroll(id){$('html,body').animate({scrollTop:$("#"+id).offset().top},'slow');}
function resetForm(id){$('#'+id).each(function(){this.reset();});}
function hideFlashes(){$('#flash_notice, #flash_warning, #flash_error').fadeOut(1500);}
function become_a_fan(path){$.ajax({url:path,type:"GET",dataType:"html",failure:function(msg){alert('ajax fail:'+msg);},success:function(msg){$('.AsDContR .fan').html(msg);}});}
function invite_chat(id){$.ajax({url:'/student_lounges/invite_chat',type:'GET',cache:false,dataType:'html',data:({user_id:id}),success:function(data){$('.AsDContR .chat').text('Chatting...');},error:function(data){alert('Error connecting to server');}});}
function add_users_to_chat(chanel_name){obj_form=document.forms['form_'+chanel_name];len=obj_form.elements.length;val="";var i=0;for(i=0;i<len;i++)
{if(obj_form.elements[i].type=="checkbox"&&obj_form.elements[i].checked)
{val+=obj_form.elements[i].value+";";}}
$.ajax({url:'/student_lounges/add_users_to_chat',type:'GET',cache:false,dataType:'html',data:({user_id:val,chanel_name:chanel_name})});}
function send_data(id,chanel_name){$.ajax({url:'/student_lounges/send_data',type:'GET',cache:false,dataType:'html',data:({chanel_name:chanel_name,chat_input:$('#chat_input_'+id).val()}),success:function(data){$("#chat_input_"+id).val("");}});}
function stop_chat(chanel_name){$.ajax({url:'/student_lounges/stop_chat',type:'GET',cache:false,dataType:'html',data:({chanel_name:chanel_name}),success:function(data){}});}
function friends_changed_message(){$.ajax({url:'/student_lounges/friends_changed_message',type:'GET',cache:false,dataType:'html',success:function(data){$('#div_friends_changed_their_message').html(data);}});}
function friends_you_invited_chat(){$.ajax({url:'/student_lounges/friends_you_invited_chat',type:'GET',cache:false,dataType:'html',success:function(data){$("#div_friends_you_invited_to_chat").html(data);}});}
function friends_want_you_chat(){$.ajax({url:'/student_lounges/friends_want_you_chat',type:'GET',cache:false,dataType:'html',success:function(data){$("#div_friends_want_you_chat").html(data);}});}
function insert_text_to_chatcontent(chanel_name,text_chat){if($('#'+chanel_name)){$('#'+chanel_name).before(text_chat);scroll_div('#chat_content_'+chanel_name);}}
function openChat(title,chanel_name){if($('#'+chanel_name).length==0){var win=$.customWindow({title:title,onopen:function(cont,obj){$.ajax({url:'/student_lounges/chanel_chat_content',type:'GET',cache:false,dataType:'html',data:({chanel_name:chanel_name}),success:function(data){cont.html(data);}});},onclose:function(){},onresize:function(obj){}});}}
